import "../style/App.scss";

function App() {
  return (
    <div className='App'>
      <section className='section-cats'>
        <h1>All Cats Are Beautiful</h1>
        <CatList></CatList>
        <ul className='section-cats_list'>
          <li>A cat</li>
          <li>Another cat</li>
          <li>Moar cat</li>
        </ul>
      </section>
    </div>
  );
}

export default App;
